import "./aboutme.scss";
import  myimg from "../myimg.jpeg"
export const AboutMe = () => {
    return (
        <div className="abutme">
           <div>
           Thank you for visiting my website! Heres something about me:

​

I am a team player who loves programming. I have 4 years of professional programming experience, where I have worked primarily in designing frontends using ReactJS, HTML and CSS. I also created backend APIs using Python (Django and Django REST frameworks) and Javascript (NodeJS). I have worked a lot with databases as well, having knowledge and experience mainly in SQL and mongoDB. Moreover, I have also created several useful Python scripts that helped certain projects during my career.

​

Professionally, I am most passionate about creating amazing front-end and the best user experience. I also love working with data.

​

Outside of work, I am an outdoors person. I love hiking, and have hiked across several mountains including at high altitudes! I love running, playing badminton and rock climbing
           </div>
           <div>
               <img alt="" src={myimg}/>
           </div>
        </div>
    );
};
